  if (arg[3]) {
    casadi_copy(arg[3], 1460, d.lbz+972);
  } else {
    casadi_fill(d.lbz+972, 1460, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 972, d.ubz);
  } else {
    casadi_fill(d.ubz, 972, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 1460, d.ubz+972);
  } else {
    casadi_fill(d.ubz+972, 1460, casadi_inf);
  }
  /* Pass initial guess */
  if (arg[7]) {
    casadi_copy(arg[7], 972, d.z);
  } else {
    casadi_clear(d.z, 972);
  }
  casadi_fill(d.z+972, 1460, casadi_nan);
  if (arg[8]) {
    casadi_copy(arg[8], 972, d.lam);
  } else {
    casadi_clear(d.lam, 972);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 1460, d.lam+972);
  } else {
    casadi_clear(d.lam+972, 1460);
  }
  /* Solve QP */
  if (casadi_qp_reset(&d)) return 1;
